import React, { useState } from 'react';
import './App.css';
import ProductCard from './components/ProductCard';

function App() {
  // Datos de ejemplo
  const [featuredProducts] = useState([
    {
      id: 1,
      name: "Producto Destacado 1",
      price: 99.99,
      image: "https://via.placeholder.com/200",
      description: "Descripción del producto destacado 1"
    },
    {
      id: 2,
      name: "Producto Destacado 2",
      price: 149.99,
      image: "https://via.placeholder.com/200",
      description: "Descripción del producto destacado 2"
    }
  ]);

  const [newProducts] = useState([
    {
      id: 3,
      name: "Producto Nuevo 1",
      price: 79.99,
      image: "https://via.placeholder.com/200",
      description: "Descripción del producto nuevo 1"
    },
    {
      id: 4,
      name: "Producto Nuevo 2",
      price: 129.99,
      image: "https://via.placeholder.com/200",
      description: "Descripción del producto nuevo 2"
    }
  ]);

  const [catalogProducts] = useState([
    {
      id: 5,
      name: "Producto Catálogo 1",
      price: 59.99,
      image: "https://via.placeholder.com/200",
      description: "Descripción del producto catálogo 1"
    },
    {
      id: 6,
      name: "Producto Catálogo 2",
      price: 89.99,
      image: "https://via.placeholder.com/200",
      description: "Descripción del producto catálogo 2"
    }
  ]);

  return (
    <div className="container">
      {featuredProducts.length > 0 && (
        <section className="products-section">
          <h2>Productos Destacados</h2>
          <div className="products-grid">
            {featuredProducts.map(product => (
              <ProductCard key={product.id} product={product} />
            ))}
          </div>
        </section>
      )}

      {newProducts.length > 0 && (
        <section className="products-section">
          <h2>Productos Nuevos</h2>
          <div className="products-grid">
            {newProducts.map(product => (
              <ProductCard key={product.id} product={product} />
            ))}
          </div>
        </section>
      )}

      {catalogProducts.length > 0 && (
        <section className="products-section">
          <h2>Catálogo Completo</h2>
          <div className="products-grid">
            {catalogProducts.map(product => (
              <ProductCard key={product.id} product={product} />
            ))}
          </div>
        </section>
      )}
    </div>
  );
}

export default App;
